import styled from "styled-components";

const MainScreen = styled.div`
    display: flex;
`;

const Menu = styled.div`
    background: pink;
    grid-column: span 3;
    display: flex;
    flex-direction: row-reverse;
    padding: 25px;
`;

const Networks = styled.div`
    background: green;
    display: flex;
    flex-direction: column-reverse;
    padding: 25px;
    align-items: center;
`;

const FirstScreen = styled.div`
    display: flex;
    flex-direction: column;
    padding: 40px;
    background: red;

    p {
        margin-top: 15px;
    }
`;

export { MainScreen, Menu, Networks, FirstScreen }
